import gql from 'graphql-tag';

const USERS_ITEMS_QUE = gql`
  query USERS_ITEMS_QUE {
    items(orderBy: PRIMARY_KEY_DESC) {
      nodes {
        id
        product
        quantity
        status
      }
    }
  }
`;

export { USERS_ITEMS_QUE };
